import './App.css';

function App() {
  return (
    <div className="App">
      <h1>반입금지 셀프 체크</h1>
      <p>금지 물품은 빨간색으로</p>
      <p>기내 또는 위탁 가능 물품은 초록색으로</p>
      <p>크기 또는 용량 제한 물품은 노란색으로</p>
      <p>표시됩니다. 사진을 업로드해주세요!</p>

      <p>업로드 전 체크해주세요</p>
      <ul>
        <li>무늬가 없는 배경에서 촬영해주세요</li>
        <li>물품 전체가 나오도록 촬영해주세요</li>
      </ul>
    </div>
  );
}

export default App;
